import React, { useEffect } from "react";
import { useState } from "react";
import { Table, Button } from "antd";
import url from "../components/host";
import axios from "axios";
import "./style/additional.css";
import { AiOutlineClose } from "react-icons/ai";

export default function Additional() {
  const [fueldata, setfueldata] = useState();
  const [fueldata1, setfueldata1] = useState();
  const [fueldata2, setfueldata2] = useState();
  const [fueldata3, setfueldata3] = useState([]);
  const [fueldata4, setfueldata4] = useState([]);
  const [fueldata5, setfueldata5] = useState();
  const [fueldata6, setfueldata6] = useState();
  const [id, setId] = useState(0);
  const [key, setkey] = useState(0);
  const [key1, setkey1] = useState(0);
  const [key2, setkey2] = useState(0);
  const [key3, setkey3] = useState(0);
  const [key4, setkey4] = useState(0);
  const [key5, setkey5] = useState(0);
  const [ seria, setSeria ] = useState([])
  const [ SelectSerias, setSelectSerias ] = useState('')
  const [ SelectPosition, setSelectPosition ] = useState('')
  // 1 - page

  const columns = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "Name_uz",
      witdh: "5%",
      dataIndex: "name_uz",
    },
    {
      title: "Name_ru",
      witdh: "5%",
      dataIndex: "name_ru",
    },

    {
      title: "Edit",
      witdh: "5%",
      render: (fueldata) => {
        return (
          <div>
            <Button
              onClick={() => postoyna11(fueldata)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => deletee(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/fuel_sort/`)
      .then((res) => {
        setfueldata(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function deletee(id) {
    axios
      .delete(`${url}/api/fuel_sort/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
        console.log(err);
      });
  }

  function getPost1() {
    var formdata1 = new FormData();
    formdata1.append("name_uz", document.querySelector("#fuel_sort_post_uz").value);
    formdata1.append("name_ru", document.querySelector("#fuel_sort_post_ru").value);
    axios
      .post(`${url}/api/fuel_sort/ `, formdata1, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postoyna10").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
      });
  }

  function getPut1(id) {
    var formdata2 = new FormData();
    formdata2.append("name", document.querySelector(".fuelname10").value);

    axios
      .put(`${url}/api/fuel_sort/${id}/`, formdata2, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postoyna11").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/fuel_sort/`)
          .then((res) => {
            setfueldata(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
      });
  }

  function postoyna11(id) {
    setId(id);
    document.querySelector(".postoyna11").style =
      "position: absolute;display:block;    transition: 1s;";
  }
  function postoynaclose11() {
    document.querySelector(".postoyna11").style =
      "position: absolute;display:none;   transition: 1s;";
  }

  function postoyna10() {
    document.querySelector(".postoyna10").style =
      "position: absolute;display:block;    transition: 1s;";
  }
  function postoynaclose10() {
    document.querySelector(".postoyna10").style =
      "position: absolute;display:none;    transition: 1s;";
  }

  // 2-page

  const columns1 = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "Name",
      dataIndex: "name",
    },

    {
      title: "Edit",
      render: (fueldata1) => {
        return (
          <div>
            <Button
              onClick={() => putoyanfuel2(fueldata1)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => deletegear(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/gear_box/`)
      .then((res) => {
        setfueldata1(res.data);
      })
      .catch((err) => {
        console.log(err, "salom");
      });
  }, []);

  function putoyanfuel() {
    document.querySelector(".putoyanfuel").style =
      "position: absolute;display:block;   transition: 1s;";
  }

  function putoyanfuel1() {
    document.querySelector(".putoyanfuel").style =
      "position: absolute;display:none;    transition: 1s;";
  }
  function putoyanfuel2(id) {
    document.querySelector(".putoyanfuel1").style =
      "position: absolute;display:block;  transition: 1s;";
    setkey(id);
  }

  function putoyanfuel3() {
    document.querySelector(".putoyanfuel1").style =
      "position: absolute;display:none;    transition: 1s;";
  }

  function getPost2() {
    var formdata3 = new FormData();
    formdata3.append("name", document.querySelector(".gearinput").value);

    axios
      .post(`${url}/api/gear_box/`, formdata3, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".putoyanfuel").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/gear_box/`)
          .then((res) => {
            setfueldata1(res.data);
          })
          .catch((err) => {
            console.log(err, "salom");
          });
      })
      .catch((err) => {
      });
  }
  function getPut2(id) {
    var formdata4 = new FormData();
    formdata4.append("name", document.querySelector(".gearinput1").value);

    axios
      .put(`${url}/api/gear_box/${id}/`, formdata4, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".putoyanfuel1").style =
          "position: fixed;display:none;   transition: 1s;";
        axios
          .get(`${url}/api/gear_box/`)
          .then((res) => {
            setfueldata1(res.data);
          })
          .catch((err) => {
            console.log(err, "salom");
          });
      })
      .catch((err) => {
      });
  }

  function deletegear(id) {
    axios
      .delete(`${url}/api/gear_box/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        window.location.reload();
      })
      .catch((err) => {
      });
  }

  // 3- page

  const columns2 = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "Name",
      dataIndex: "name",
    },
    {
      title: "Time",
      dataIndex: "time",
    },

    {
      title: "Edit",
      render: (fueldata2) => {
        return (
          <div>
            <Button
              onClick={() => putgarantoyna(fueldata2)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => deletegarant(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/garant/`)
      .then((res) => {
        setfueldata2(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function postgarantoyna() {
    document.querySelector(".postgarantoyna").style =
      "position: absolute;display:block;   transition: 1s;";
  }

  function postgarantoyna1() {
    document.querySelector(".postgarantoyna").style =
      "position: absolute;display:none;    transition: 1s;";
  }

  function getPost3() {
    var formdata5 = new FormData();
    formdata5.append("name", document.querySelector(".gearinput2").value);
    formdata5.append("time", document.querySelector(".gearinput3").value);

    axios
      .post(`${url}/api/garant/`, formdata5, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postgarantoyna").style =
          "position: absolute;display:none;   transition: 1s;";
        axios
          .get(`${url}/api/garant/`)
          .then((res) => {
            setfueldata2(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
      });
  }
  function getPut3(id) {
    var formdata6 = new FormData();
    formdata6.append("name", document.querySelector(".gearinput5").value);
    formdata6.append("time", document.querySelector(".gearinput4").value);

    axios
      .put(`${url}/api/garant/${id}/`, formdata6, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".putgarantoyna").style =
          "position: absolute;display:none;    transition: 1s;";
        axios
          .get(`${url}/api/garant/`)
          .then((res) => {
            setfueldata2(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
      });
  }

  function deletegarant(id) {
    axios
      .delete(`${url}/api/garant/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        axios
          .get(`${url}/api/garant/`)
          .then((res) => {
            setfueldata2(res.data);
          })
          .catch((err) => {
            console.log(err);
          });
      })
      .catch((err) => {
      });
  }

  function putgarantoyna(id) {
    document.querySelector(".putgarantoyna").style =
      "position: absolute;display:block;  transition: 1s;";
    setkey1(id);
  }

  function putgarantoyna1() {
    document.querySelector(".putgarantoyna").style =
      "position: absolute;display:none;    transition: 1s;";
  }

  // 4 -page

  const columns3 = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "Name_ru",
      dataIndex: "name_ru",
    },
    {
      title: "Name_uz",
      dataIndex: "name_uz",
    },

    {
      title: "Edit",
      render: (fueldata3) => {
        return (
          <div>
            <Button
              onClick={() => putmodeloyna(fueldata3)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => getdeletemodel(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/models/`)
      .then((res) => {
        setfueldata3(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function postmodeloyna() {
    document.querySelector(".postmodeloyna").style =
      "position: absolute;display:block;    transition: 1s;";
  }

  function postmodeloyna1() {
    document.querySelector(".postmodeloyna").style =
      "position: absolute;display:none;   transition: 1s;";
  }
  function putmodeloyna(id) {
    document.querySelector(".putmodeloyna").style =
      "position: absolute;display:block;  transition: 1s;";
    setkey2(id);
  }

  function putmodeloyna1() {
    document.querySelector(".putmodeloyna").style =
      "position: absolute; display:none;  transition: 1s;";
  }

  function getPostmodel() {
    var model = new FormData();
    model.append("name_uz", document.querySelector("#model_post_uz").value);
    model.append("name_ru", document.querySelector("#model_post_ru").value);

    axios
      .post(`${url}/api/models/`, model, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".postmodeloyna").style =
          "position: absolute;display:none;   transition: 1s;";
        axios
          .get(`${url}/api/models/`)
          .then((res) => {
            setfueldata3(res.data);
          })
          .catch((err) => {

          });
      })
      .catch((err1) => {
      });
  }

  function getPutmodel(id) {
    var model = new FormData();
    model.append("name_uz", document.querySelector("#model_put_uz").value);
    model.append("name_ru", document.querySelector("#model_put_ru").value);
    axios
      .put(`${url}/api/models/${id}/`, model, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        document.querySelector(".putmodeloyna").style =
          "position: absolute;display:none;   transition: 1s;";
        axios
          .get(`${url}/api/models/`)
          .then((res) => {
            setfueldata3(res.data);
          })
          .catch((err) => {
            console.log(err, "ishlamadi");
          });
      })
      .catch((err1) => {
      });
  }

  function getdeletemodel(id) {
    axios
      .delete(`${url}/api/models/${id}/`, {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      })
      .then((res) => {
        axios
          .get(`${url}/api/models/`)
          .then((res) => {
            setfueldata3(res.data);
          })
          .catch((err) => {
          });
      })
      .catch((err1) => {
      });
  }

  // 5 -pages

  const columns4 = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "Name ru",
      dataIndex: "name_ru",
    },
    {
      title: "Name uz",
      dataIndex: "name_uz",
    },

    {
      title: "Edit",
      render: (fueldata4) => {
        return (
          <div>
            <Button
              onClick={() => putseriesoyna(fueldata4)}
              style={{ background: "orange", color: "white" }}
              type="button"
            >
              O'zgartirish
            </Button>
          </div>
        );
      },
    },
    {
      title: "Delet",
      witdh: "5%",
      render: (key) => {
        return (
          <div>
            <Button onClick={() => getDeleteseries(key.id)} type="danger">
              O'chirish
            </Button>
          </div>
        );
      },
    },
  ];

  useEffect(() => {
    axios
      .get(`${url}/api/series/`)
      .then((res) => {
        setfueldata4(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  function postseriesoyna() {
    document.querySelector(".postserisoyna").style =
      "position: absolute;display:block;";
  }

  function postseriesoyna1() {
    document.querySelector(".postserisoyna").style =
      "position: absolute;display:none;";
  }

  function putseriesoyna(id) {
    document.querySelector(".putserisoyna1").style =
      "position: absolute;display:block;";
    setkey3(id);
  }

  function putseriesoyna1() {
    document.querySelector(".putserisoyna1").style =
      "position: absolute;display:none;";
  }

  function renderSelect() {
    var vall = document.querySelector(".selectFuels").value;
    axios.get(`${url}/api/models/`).then((res) => {
      // var gg = []
      res.data.map((item) => {
        if (vall == item.name) {
